import numpy as np

from ch7.code.ch7_12 import string_to_chromosome_array, colored_edges, chromosome_array_to_string
from ch7.code.ch7_13 import _2_break_on_genome


def _2_break_distance(p, q):
    """
    given the genome p (+1 +2 +3 +4 +5 +6) and the genome q (+1 -3 -6 -5)(+2 -4),
    find the two break distance 3
    """
    graph = {}
    # print(p)
    # print(q)
    # print(p + q)
    for chromosome in p + q:
        n = len(chromosome)
        for i in range(n):
            next_chromosome_reversed = -1 * chromosome[i + 1 if i < n - 1 else 0]

            if chromosome[i] in graph:
                graph[chromosome[i]].append(next_chromosome_reversed)
            else:
                graph[chromosome[i]] = [next_chromosome_reversed]

            if next_chromosome_reversed in graph:
                graph[next_chromosome_reversed].append(chromosome[i])
            else:
                graph[next_chromosome_reversed] = [chromosome[i]]
    count = 0
    keys = set(graph.keys())
    while keys:
        count += 1
        queue = {keys.pop()}
        while queue:
            current = queue.pop()
            new = {node for node in graph[current] if node in keys}
            queue = queue if queue else new
            keys -= new
    return sum([len(x) for x in p]) - count


def shortest_rearrangement_scenario(blue, red):
    cycles = []
    length = len(blue) + len(red)
    # adj = np.zeros(shape=(size, 2), dtype=np.int)
    adj = [[0] * 2 for i in range(length)]

    # visited = np.zeros(shape=size, dtype=np.bool)
    visited = [False] * length

    for e in blue:
        adj[e[0] - 1][0] = e[1] - 1
        adj[e[1] - 1][0] = e[0] - 1
    for e in red:
        adj[e[0] - 1][1] = e[1] - 1
        adj[e[1] - 1][1] = e[0] - 1

    for node in range(length):
        if not visited[node]:
            visited[node] = True
            head = node
            cycle = [head + 1]
            color = 0
            while True:
                node = adj[node][color]
                if node == head:
                    cycles.append(cycle)
                    break
                cycle.append(node + 1)
                visited[node] = True
                color = (color + 1) % 2
    return cycles


def _2_break_sorting(p, q):
    red = colored_edges(q)
    path = [p]
    while _2_break_distance(p, q) > 0:
        cycles = shortest_rearrangement_scenario(colored_edges(p), red)
        for i in cycles:
            if len(i) >= 4:
                p = _2_break_on_genome(p, i[0], i[1], i[3], i[2])
                path.append(p)
                break
    return path


